import React from 'react';
import Grid from '@material-ui/core/Grid';
import Button from '@material-ui/core/Button';

const Introduction = () => {
	return (
		<Grid container direction='column' justify='flex-start' alignItems='center'>
			<Grid item style={{ height: 110 }}>
				<h1 className='heading'>تایپ آنلاین به‌صرفه</h1>
			</Grid>
			<Grid item className='border' style={{ height: 100 }}>
				<h3 className='heading' style={{ fontSize: '2em' }}>
					تیزتایپ، وب‌سایتی برای سفارش و انجام پروژه‌های تایپ بصورت آنلاین
				</h3>
			</Grid>
			<Grid item>
				<Button variant='outlined' color='primary' size='large'>
					همین حالا شروع کنید
				</Button>
			</Grid>
		</Grid>
	);
};

export default Introduction;
